import React, { Component } from 'react';
import '../../App.css';

import 'bootstrap/dist/css/bootstrap.css'
import '@fortawesome/fontawesome-free/css/all.css'

import { Row } from 'reactstrap'
import TopBar from '../Nav/TopBar/TopBar'
import LeftBar from '../Nav/LeftBar/LeftBar'
import NavItem from '../Nav/NavItem/NavItem'
import QuickView from '../QuickView/QuickView'
import ReportControl from '../ReportControl/ReportControl'
import ChartCard from '../Card/ChartCard/ChartCard'
import StdCard from '../Card/StdCard'
import DataTable from '../Table/DataTable';
import InputTable from '../Table/InputTable'

export default class MainDashboard extends Component {

  state = {
    showReportFilter: false
  }

  data = {
    labels: ["a", "b", "c", "d", "e", "f", "g"],
    datasets: [{
      label: "Data",
      backgroundColor: '#4099ff',
      borderColor: '#4099ff',
      data: [0, 10, 0, 12, 10, 12, 1],
    }]
  }
  dataBar = {
    labels: ["January", "February", "March", "April", "May", "June", "July"],
    datasets: [
      {
        label: "f_Data",
        backgroundColor: '#4099ff',
        data: [2, 13, 5, 2, 20, 3, 10],
      },
      {
        label: "Sec_data",
        backgroundColor: '#FFE031',
        data: [10, 2, 6, 12, 8, 0, 22],
      }
    ]
  }
  data_line = {
    labels: ["January", "February", "March", "April", "May", "June", "July"],
    datasets: [{
      label: "My First dataset",
      backgroundColor: '#4099ff',
      borderColor: '#4099ff',
      data: [0, 10, 5, 2, 20, 30, 45],
    }]
  }
  dataRound = {
    labels: ["a", "b"],
    datasets: [{
      label: "Data",
      backgroundColor: ['#4099ff', '#FFF3201'],
      borderColor: 'transparent',
      data: [90, 10],
    }]
  }

  switchShowReportFilter = () => {
    this.setState(state => ({ showReportFilter: !state.showReportFilter }));
  }

  render() {
    return (
      <div>
        <TopBar>
          <NavItem icon="fas fa-filter" onClick={this.switchShowReportFilter} />
        </TopBar>
        <LeftBar>
          <NavItem icon="fa fa-signal"></NavItem>
          <NavItem icon="fa fa-users"></NavItem>
          <NavItem icon="fa fa-check-square "></NavItem>
          <NavItem icon="fa fa-download"></NavItem>
          <NavItem icon="fa fa-upload"></NavItem>
          <NavItem icon="fas fa-sign-out-alt" />
        </LeftBar>
        <div class="main-data">
          <div className="container-fluid">
            <ReportControl show={this.state.showReportFilter} />
            <QuickView />
            <Row>
              <StdCard icon="fa fa-table" headerText="table _test">
                
                <InputTable></InputTable>
              </StdCard>
              <ChartCard chartType="Bar" data={this.dataBar} headerText="Graf" height={300} width={700} />
              <ChartCard chartType="Line" data={this.data_line} headerText="Graf" height={300} width={700} />
            </Row>
            <Row>
              <ChartCard chartType="Line" data={this.data} headerText="Line_test" height={300} width={700} />
              <ChartCard chartType="Bar" data={this.data} headerText="Bar_test" height={300} width={700} />
              <ChartCard chartType="Pie" data={this.dataRound} headerText="Pie Test" height={300} width={700} />
              <ChartCard chartType="Doughnut" data={this.dataRound} headerText="Doughnut test" height={300} width={700} />
              <ChartCard chartType="hBar" data={this.dataBar} headerText="Horizontal Bar" height={300} width={700} />
              <ChartCard chartType="Radar" data={this.dataBar} headerText="Radar test" height={300} width={700} />
            </Row>
          </div>
        </div>
      </div>
    );
  }
}
